import React, { useState, useEffect, useMemo } from 'react';
import {
  Container,
  Grid,
  Button,
  Typography,
  Box,
  Paper,
  Alert,
  CircularProgress,
  ButtonGroup,
  IconButton,
  Tooltip
} from '@mui/material';
import UndoIcon from '@mui/icons-material/Undo';
import { v4 as uuidv4 } from 'uuid';

interface SequenceItem {
  symbol: number;
  created_at: string;
}

interface AnalysisData {
  markovChain?: {
    value?: number[][];
    predictedNext?: number;
    confidence: number;
  };
  entropy?: {
    value: number;
    predictedNext?: number;
    confidence: number;
  };
  chiSquare?: {
    value: number;
    predictedNext?: number;
    confidence: number;
  };
  monteCarlo?: {
    predictedNext?: number;
    confidence: number;
  };
}

interface SequenceResponse {
  success: boolean;
  batchId: string;
  sequence: SequenceItem;
}

interface WebSocketUpdate {
  type: 'sequence_update';
  data: {
    analysisResults: AnalysisData;
    sequence: SequenceItem;
  };
}

interface ErrorState {
  message: string;
  type: 'error' | 'warning' | 'info';
  timestamp: number;
}

const GameAnalysisPage: React.FC = () => {
  const [sequence, setSequence] = useState<SequenceItem[]>([]);
  const [analysisData, setAnalysisData] = useState<AnalysisData>({});
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState<ErrorState | null>(null);
  const [retryCount, setRetryCount] = useState(0);
  const MAX_RETRIES = 3;

  const symbols = ['♠', '♥', '♦', '♣'];

  const sessionId = useMemo(() => uuidv4(), []);

  const handleError = (message: string, type: ErrorState['type'] = 'error') => {
    setError({
      message,
      type,
      timestamp: Date.now()
    });

    if (type === 'error') {
      setRetryCount(prev => prev + 1);
    }
  };

  useEffect(() => {
    if (retryCount >= MAX_RETRIES) {
      handleError('Maximum retry attempts reached. Please refresh the page.', 'warning');
    }
  }, [retryCount]);

  useEffect(() => {
    const socket = new WebSocket(`ws://localhost:5000/ws/${sessionId}`);

    socket.onmessage = (event) => {
      const update: WebSocketUpdate = JSON.parse(event.data);
      if (update.type === 'sequence_update') {
        setAnalysisData(update.data.analysisResults);
      }
    };

    return () => {
      socket.close();
    };
  }, [sessionId]);

  const loadData = async () => {
    try {
      setLoading(true);
      setError(null);

      // Fetch sequence and analysis data
      const [seqResponse, analysisResponse] = await Promise.all([
        fetch('http://localhost:5000/api/sequences/1'),
        fetch('http://localhost:5000/api/analysis/1')
      ]);

      const seqData = await seqResponse.json();
      const analysisData = await analysisResponse.json();

      // Update states
      setSequence(Array.isArray(seqData?.symbols) ? seqData.symbols : []);
      if (analysisData.analyses) {
        setAnalysisData(analysisData.analyses);
      }
    } catch (error) {
      console.error('Error loading data:', error);
      handleError(error instanceof Error ? error.message : 'Failed to load data');
    } finally {
      setLoading(false);
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  const handleCardClick = async (index: number) => {
    try {
      if (retryCount >= MAX_RETRIES) {
        handleError('Please refresh the page to continue.', 'warning');
        return;
      }

      setLoading(true);
      setError(null);

      const response = await fetch('/api/sequence', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ sessionId, symbol: index })
      });

      if (!response.ok) {
        throw new Error(`HTTP error! status: ${response.status}`);
      }

      const data: SequenceResponse = await response.json();

      setSequence(prev => [...prev, {
        symbol: index,
        created_at: new Date().toISOString()
      }]);

    } catch (error) {
      console.error('Error:', error);
      handleError(error instanceof Error ? error.message : 'Failed to submit sequence');
    } finally {
      setLoading(false);
    }
  };

  const undoLastSymbol = async () => {
    try {
      setError(null);
      await fetch('http://localhost:5000/api/sequences/1/undo', {
        method: 'DELETE',
      });
      await loadData();
    } catch (error) {
      console.error('Error undoing last symbol:', error);
      handleError(error instanceof Error ? error.message : 'Failed to undo last symbol');
    }
  };

  const generateTestData = async () => {
    try {
      setError(null);

      await fetch('http://localhost:5000/api/sequences/generate-test-data', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ count: 90 })
      });

      await loadData();
    } catch (err) {
      console.error('Error generating test data:', err);
      handleError(err instanceof Error ? err.message : 'Failed to generate test data');
    }
  };

  const renderAnalysisTool = (name: string, data: any) => {
    if (!data) return null;

    return (
      <Grid item xs={6}>
        <Paper elevation={2} sx={{ p: 1.5, height: '100%' }}>
          <Typography variant="subtitle1" sx={{ fontWeight: 'bold', mb: 1 }}>
            {name}
          </Typography>
          <Box>
            <Typography variant="body2" sx={{ mb: 0.5 }}>
              Next: {data.predictedNext !== undefined ? (
                <span style={{ fontWeight: 'bold', fontSize: '1.1em' }}>
                  {symbols[data.predictedNext]}
                </span>
              ) : 'N/A'}
            </Typography>
            <Typography variant="body2" sx={{ fontSize: '0.9em', color: 'text.secondary' }}>
              Confidence: {(data.confidence * 100).toFixed(1)}%
            </Typography>
            <Typography variant="body2" sx={{ fontSize: '0.9em', color: 'text.secondary' }}>
              Accuracy: {(data.accuracy * 100).toFixed(1)}%
            </Typography>
          </Box>
        </Paper>
      </Grid>
    );
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4, mb: 4 }}>
      {error && (
        <Alert 
          severity={error.type}
          onClose={() => setError(null)}
          sx={{ mb: 2 }}
        >
          {error.message}
          {error.type === 'warning' && (
            <Button
              size="small"
              onClick={() => window.location.reload()}
              sx={{ ml: 2 }}
            >
              Refresh Page
            </Button>
          )}
        </Alert>
      )}

      <Grid container spacing={3}>
        {/* Game Controls */}
        <Grid item xs={12} md={4}>
          <Paper elevation={3} sx={{ p: 3 }}>
            <Typography variant="h5" gutterBottom>
              Game Controls
            </Typography>
            <Box sx={{ mb: 3 }}>
              <ButtonGroup 
                variant="contained" 
                size="large"
                sx={{ 
                  mb: 2,
                  '& .MuiButton-root': {
                    fontSize: '1.5rem',
                    padding: '12px 24px',
                  }
                }}
              >
                {symbols.map((symbol, index) => (
                  <Button
                    key={symbol}
                    onClick={() => handleCardClick(index)}
                    disabled={loading}
                  >
                    {symbol}
                  </Button>
                ))}
              </ButtonGroup>
            </Box>
            <Box sx={{ display: 'flex', alignItems: 'center', mb: 3 }}>
              <Button
                variant="contained"
                onClick={generateTestData}
                disabled={loading}
                sx={{ mr: 2 }}
              >
                Generate Test Data
              </Button>
              <IconButton 
                onClick={undoLastSymbol}
                disabled={loading || sequence.length === 0}
                color="primary"
                size="large"
              >
                <UndoIcon fontSize="large" />
              </IconButton>
            </Box>
            <Typography variant="h6">
              Total Symbols: {sequence.length}
            </Typography>
          </Paper>
        </Grid>

        {/* Analysis Results */}
        <Grid item xs={12} md={5}>
          <Paper elevation={3} sx={{ p: 2 }}>
            <Typography variant="h6" gutterBottom>
              Analysis Results
            </Typography>
            {loading ? (
              <Box sx={{ display: 'flex', justifyContent: 'center', p: 2 }}>
                <CircularProgress />
              </Box>
            ) : (
              <Grid container spacing={2}>
                {Object.entries({
                  'Markov': analysisData.markovChain,
                  'Entropy': analysisData.entropy,
                  'Chi²': analysisData.chiSquare,
                  'Monte Carlo': analysisData.monteCarlo
                }).map(([name, data]) => (
                  data && (
                    <Grid item xs={8} key={name}>
                      <Paper 
                        elevation={1} 
                        sx={{ 
                          p: 1, 
                          backgroundColor: 'background.default',
                          height: '100%'
                        }}
                      >
                        <Typography variant="subtitle2" sx={{ fontWeight: 'bold' }}>
                          {name}
                        </Typography>
                        <Typography variant="body2" sx={{ mt: 0.5 }}>
                          {data.value !== undefined 
                            ? `Value: ${typeof data.value === 'number' ? data.value.toFixed(3) : 'N/A'}` 
                            : 'Value: N/A'}
                        </Typography>
                        <Typography variant="body2">
                          Next: <strong>
                            {data.predictedNext !== undefined && data.predictedNext >= 0 && data.predictedNext < symbols.length 
                              ? symbols[data.predictedNext] 
                              : 'N/A'}
                          </strong>
                        </Typography>
                        <Typography variant="caption" display="block" color="text.secondary">
                          Conf: {data.confidence ? `${(data.confidence * 100).toFixed(0)}%` : 'N/A'}
                        </Typography>
                      </Paper>
                    </Grid>
                  )
                ))}
              </Grid>
            )}
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default GameAnalysisPage;
